const containerStyles = {
    height: "60px",
    marginBottom: "20px"
};

// const Wrapper = styled.div`
//     padding: 10px 20px;
//     display: flex;
//     justify-content: space-between;
//     align-items: center;
// `;

const wrapperStyles = {
    padding: "10px 20px", 
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center"
};

// Designing the Left side components of the Navbar
// const Left = styled.div`
//     flex: 1;  
//     display: flex;  
//     align-items: center;
// `;

const leftStyle = {
    flex: "1",  
    display: "flex",  
    alignItems: "center"
};

// const Language = styled.div`
//     font-size: 14px;
//     ${'' /* cursor: pointer; */}
// `;

const language = {
    fontSize: "14px",
};

const SearchContainer = styled.div`
    border: 0.5px solid lightgray;
    display: flex;
    align-items: center;
    margin-left: 25px;
    padding: 5px;
    placeholder: "Search";
`;

const Input = styled.input`
    border: none;
`;

// Designing the Center side components of the Navbar
// const Center = styled.div`
//     flex: 1;   
//     text-align: center; 
// `;

const centerStyle = {
    flex: "1",
    textAlign: "center"
};

const Logo = styled.h1`
    font-weight: bold;
`;

// Designing the Right side components of the Navbar
// const Right = styled.div`
//     flex: 1;  
//     display: flex;
//     align-items: center;
//     justify-content: flex-end;
// `;

const rightStyle = {
    flex: "1",
    display: "flex",
    alignItems: "center",
    justifyContent: "center"
};


const MenuItem = styled.div`
    font-size: 14px;
    cursor: pointer;
    margin: 20px;
`;


const Navbar = () => {

    <div style={containerStyles}>
        <div style={wrapperStyles}>

            {/* Left Side */}
            <div style={leftStyle}>
            <div style={language}>EN/LI</div>
                 <SearchContainer>
                     <Input /> 
                     <SearchOutlined style={{color: "gray", fontSize: 16}}/>
                 </SearchContainer>
            </div>

            {/* Center Side */}
            <div style={centerStyle}>

            </div>

            {/* Right Side */}
            <div style={rightStyle}>

            </div>

        </div>
    </div>
}


export default Navbar;

